// import homeImage from '../src/static/loginHome.jpeg'
function App() {
  return (
    <div className="container">
      {/* <img src={homeImage} alt="login" className="login-form-image"/> */}
      <form className="input-form">
        <p className="login-header"> Login into the world of table tennis</p> <br />
        <label>Email Id: <input type="text" className="login-form-input"/></label><br /><br />
        <label>Password: <input type="text" className="login-form-input"/></label><br /><br />
        <input type="checkbox" id="remember" />
        <label for="checkbox" className="login-remember"> remember me</label>
        <p className="login-forget-password"> Forget Password?</p>
        <button type="submit" className="login-submit-button">Login</button>

      </form>
    </div>
  );
}

export default App;
